import React,{Component} from 'react';
import socketIOClient from "socket.io-client";
import  '../Style/Style.css'

const ENDPOINT = "http://127.0.0.1:4000";


class Screen extends  Component
{

    constructor(props)
    {
        super(props);

        this.state ={
            altitude: '',
            HIS : '',
            ADI : ''
        };

        console.log('Constructor');
        
    }

    componentDidMount(){
        console.log('Component');
        const socket = socketIOClient(ENDPOINT);
        socket.on("Data", data => {
            this.setState({altitude : data[0],HIS : data[1],ADI : data[2]});
        });
    }

    render()
    {
        console.log('render');
        const data = this.state;
        return(

            <div>

               <h1>Hello </h1>

                <div className="container">
                    <div className="button_container">
                        <button id="text_btn"   >Text</button>
                        <button id="visual_btn"  >Visual</button>
                    </div>
                    <div className="altitude_container"></div>
                    <div className="ADI_container"></div>
                    <div className="HIS_container">
                        <div className="eclipse" >
                            <div className="green"></div>
                            <div className="blue"></div>

                        </div>
                    </div>



                </div>
            </div>

        )
    }


}

export default Screen;
